import React from 'react';
import Button from 'react-bootstrap/Button';

import "./SidebarControl.css"

const SidebarCotrol = (props) =>{

return (
  <div className="SidebarCotrol">

    <Button className="sidebarButton" variant="success" onClick={props.onShowSidebar}>+</Button>
    <Button className="sidebarButton" variant="danger" onClick={props.onHideSidebar}>X</Button>

  </div>
)

}


export default SidebarCotrol;
